import DoingList from './components/Lists/doing';
import DoneList from './components/Lists/deleted';
import DeletedList from './components/Lists/done';

const App = props => {
    return (
        <>
            <AddTask />
            {/* <Task /> */}
            <DoingList />
            <div style={{ display:'flex'}}>
            <DeletedList/>
            <DoneList/>
            </div>
        </>
    )
}



export default App;
